export const toc = [{
  value: 'Step 1. Register and subscribe',
  id: 'step-1-register-and-subscribe',
  children: []
}, {
  value: 'Step 2. Create a database with RedisJSON Module',
  id: 'step-2-create-a-database-with-redisjson-module',
  children: []
}, {
  value: 'Step 3. Connect to a database',
  id: 'step-3-connect-to-a-database',
  children: []
